import React, { ReactNode, VFC } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import { Header } from './components/Header';
import { ItemDetail } from './components/ItemDetail';
import { ItemsLists } from './components/ItemsLists';


type Props = {
  exact: boolean;
  path: string;
  children: ReactNode;
  loginUser: boolean;
};

const App:VFC<Props> = (props) => {


  return (
    <div className="App">
      <Header/>
      <BrowserRouter>
        <Routes>
          <Route exact path='/' component={ItemsLists}/>
          <Route  path='/detail' component={ItemDetail}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
